import { createMuiTheme } from '@material-ui/core/styles';

const MyTheme = createMuiTheme({
    palette: {
      primary: {
        main:"#F02000",
      },
      secondary: {
        main: '#11cb5f',
      },
     
    },

    typography: {
      fontFamily: 'Raleway, Arial',
    },
    overrides: {
      MuiCssBaseline: {
        '@global': {
          '@font-face': [raleway],
        },
      },
    },
  });

export default MyTheme
